import React, { Component } from 'react';
import './App.css';

class Course {
  constructor(college, dept, number, section, prof) {
    this.college = college;
    this.dept = dept;
    this.number = number;
    this.section = section;
    this.prof = prof;
    this.key = `${this.college} ${this.dept} ${this.number} ${this.section} ${this.prof}`;
  }
}

class App extends Component {
  constructor(props) {
    super(props);
    const columns = [
      'College',
      'Department',
      'Number',
      'Section',
      'Professor',
    ];

    const courses = [
      new Course('CAS', 'CS', '112', 'B1', 'Sullivan'),
      new Course('CAS', 'CS', '332', 'A1', 'Bun'),
      new Course('CAS', 'CS', '350', 'A1', 'Sarkar'),
    ];

    this.state = {
      columns,
      courses,
    };
    this.addNew = this.addNew.bind(this);
  }

  render() {
    return (
        <table>
          <thead>
          <td>College</td> <td>Department</td> <td>Number</td> <td>Section</td> <td>Professor</td>
          </thead>
          <tbody>
            {
              courses.map(course => <tr key={course.key}><th>{course.college}</th> <th>{course.dept}</th> <th>{course.number}</th> <th>{course.section}</th> <th>{course.prof}</th></tr>)
            }
          </tbody>
        </table>
    );
  }
}

export default App;
